const router = createBrowserRouter([
  {
    path: "/",
    element: <Root />,
    errorElement: <Error />,
    children: [
      {
        index: true,
        element: <App />
      },
      {
        path: "price",
        element: <Price />
      },
      {
        path: "blog",
        element: <Blog />
      },
      {
        path: "about",
        element: <About />
      },
      {
        path: "contact",
        element: <Contact />
      },
    ]
  },
  {
    path: "shop",
    element: <Provider store={store}><ShopRoot /></Provider>,
    children: [
      {
        index: true,
        element: <YourShop />
      },
      {
        path: "login",
        element: <LoginShop />,
      },
      {
        path: "forget-password",
        element: <ForgetPassword title='نسيت كلمة المرور' />,
      },
      {
        path: "verify-password",
        element: <ForgetPassword title='كود تأكيد التسجيل' />,
      },
      {
        path: "create-store",
        element: <CreateShop />,
        children: [
          {
            index: true,
            element: <FormInfos />
          },
          {
            path: "your-shop-information",
            element: <FormYourShop />
          },
          {
            path: "personal-identification",
            element: <Identification />
          },
        ]
      },
    ]
  },
  {
    path: "dashboard",
    element: <Provider store={store}><DashboardRoot /></Provider>,
    children: [
      {
        index: true,
        element: <Main />
      },
      {
        path: "products",
        element: <Products />,
        children: [
          {
            path: "bar",
            element: <Table headerTitle={headerTitle} bodyTitle={bodyTitle} />,
          }
        ]
      },
      {
        path: "customers",
        element: <Customers />
      },
      {
        path: "requests",
        element: <Requests />
      },
    ]
  }

])

const root = createRoot(document.getElementById('root'));
root.render(<RouterProvider router={router} />);
